import React from 'react';
import {connect} from "react-redux";
import {IDriver} from "../../../../shared/interfaces/IDriver";

interface OwnProps {
    taskId: string;
}

interface StateProps {
    drivers: Array<IDriver>;
}

interface DispatchProps {

}

type Props = OwnProps & StateProps & DispatchProps;

class DriverSelect extends React.Component<Props, {}> {
    render() {
        return (
            <div className="driver-select">
                <span className="driver-select_selected">
                    {this.props.taskId}
                </span>
            </div>
        )
    }
}

const mapStateToProps = (state: StateProps, ownProps: OwnProps): StateProps => {
    return state;
};

export default connect(mapStateToProps, {})(DriverSelect);
